import './card.css'
export default function PokemonCard(props) {
  return (
    <div className="caja-carta">
      <Link></Link>
     <img src={props.image} alt={props.name}  width="90"
       height="70" />
     <h2 className='letra-de-caja'>name:{props.name}</h2>
     <h2>type{props.id}</h2>

    </div>

  )
}
